VB Knowledge Solutions cdTree 3.1.4

cdTree allows you to catalog all of your CD-ROMs, CR-RWs, DVDs, and even hard-disk folders for offline browsing. This will allow you to easily locate a file in your CD collection and it will let you manage space efficiently on all your CDs. 

cdTree also allow you to attach comments and extra attributions to the folder name, directory, or even the specific files, later on you can search through the notes for specific keywords.

cdTree allows you to group your CDs or folders within Groups or Categories (ie: Games, Sources, Utils,...) and it will also allow you to attach various attribution to each group container.

cdTree features two view modes, a windows explorer like mode, and a traditional view mode.
